import {
  BASE_URL,
  signupManager as signupManagerUrl,
  loginManager as loginManagerUrl,
} from "../services";


export const loginManager = createApi({
  baseQuery: fetchBaseQuery({ baseUrl: BASE_URL }),
  endpoints: (builder) => ({
    loginManager: builder.mutation({
      query: (newManager) => ({
        url: loginManagerUrl,
        method: "POST",
        body: newManager,
      }),
    }),
  }),
});

export const { useSignupManagerMutation } = signupManager;
export const { loginManagerMutation } = loginManager;
